import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const [data, setData] = useState([{}]);
    var letter = ""

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                // console.log(data)
            }
        )  
    }, [])


    return (
        <div className='Diagnose-page'>
            <h1>Select Symptoms: </h1>

            {(typeof data === "undefined") ? (
                <p> Loading...</p>
            ) : (

                data.map((item, i) => (

                    <div>
                        {/* console.log({item[0][0]}); */}
                        {letter!=item[0][0]? (<h3>{letter}</h3>) : "hi"}
                        <Togglebutton name={item} />
                    </div>
                ))
            )}
        </div>
    );
}

export default Diagnose;
